import React from 'react'

const Navbar = () => {
  return (
    <div className='bg-gray-800'>
      <div className='h-14 px-8 flex items-center'>
        <p className='text-white font-bold'>
          Employee Management System
        </p>

      </div>
    </div>
  )
}

export default Navbar
